_PY_LOCK = Lock()


def locate_via_pep514(spec):
    with _PY_LOCK:
        if not _PY_AVAILABLE:
            from . import pep514

            _PY_AVAILABLE.extend(pep514.discover_pythons())
            _PY_AVAILABLE.append(CURRENT)
    for cur_spec in _PY_AVAILABLE:
        if cur_spec.satisfies(spec):
            return cur_spec.path
